const JobCardsLayout = (articleLayout) => {
  return () => (
    <div>
      <div className="centered">
        <h1>{title}</h1>
        <section className="card">
          <articleLayout />
        </section>
      </div>
    </div>
  );
};

export default JobCardsLayout;
